import San_Pham from "./San_Pham";
function Loai_San_Pham(truyen)
{
  

    return (
        <>
        <h1>{ truyen.data.ten}</h1>
        <div class="row">
        <div class="col-sm-3">
        <div class="SanPham">
        <div class="TopSP">
                    <IMG url={truyen.data.img} />
                </div>
                <div class="Center1SP">
                    <NAME nm={truyen.data.name} />
                </div>
            
                <div class="Center2SP">
                    <Price pr={truyen.data.price}/>
                </div>
        </div>
        </div>
        </div>
        </>
    );

}

export default Loai_San_Pham;
